import React from "react";
import './style.css';
import logoImage from '../../assets/java.png';
import { Link } from "react-router-dom";
import { FiPower } from "react-icons/fi";

export default function Password() {
    return (
        <div className="password-container">
            <header>
                <img src={logoImage} alt="Java" />
                <span>Bem-vindo, <strong>Kleber</strong>!</span>
                <Link className="button" to="/new">Cadastrar nova senha</Link>
                <button type="button">
                    <FiPower size={18} color="#E02041" />
                </button>
            </header>

            <h1>Senhas cadastradas</h1>
            <ul>
                <li>
                    <strong>Descrição:</strong>
                    <p>Santander</p>
                    <strong>Url:</strong>
                    <p>https://santander.com.br</p>
                    <strong>Usuário:</strong>
                    <p></p>
                </li>
            </ul>
        </div>
    )
}
